/** 
 * @param context the context to use
 * @param sharedPreferences the shared preferences to query values from
 * @param slotCount remove indices >= than this value (set to {@code 5} to do nothing, or makeit lower if there are slots with empty actions)
 * @return a sorted list of the indices of the slots to use as compact slots
 */
public static List<Integer> getCompactSlotsFromPreferences(@NonNull final Context context,final SharedPreferences sharedPreferences,final int slotCount){
  final SortedSet<Integer> compactSlots=new TreeSet<>();
  for (int i=0; i < 3; i++) {
    final int compactSlot=sharedPreferences.getInt(context.getString(SLOT_COMPACT_PREF_KEYS[i]),Integer.MAX_VALUE);
    if (compactSlot == Integer.MAX_VALUE) {
      return new ArrayList<>(SLOT_COMPACT_DEFAULTS);
    }
    if (compactSlot >= 0 && compactSlot < slotCount) {
      compactSlots.add(compactSlot);
    }
  }
  return new ArrayList<>(compactSlots);
}
